import Layout from '../components/Layout';
import Link from 'next/link';

const Main = () => (
    <Layout>
        <style jsx>
            {`
                a {
                    color: white
                    background-color: green
                }
            `}
        </style>
        <Link href='mytree'><a>내 나무 관리</a></Link><br />
        <Link href='lookup'><a>나무 조회</a></Link><br />
        <Link href='treatment'><a>나무 진료</a></Link>
    </Layout>
)

export default Main;
